import { createFileRoute, Link } from "@tanstack/react-router";
import { useSuspenseQuery, useQueryClient } from "@tanstack/react-query";
import { useState } from "react";
import { Plus, ChevronDown, ChevronUp } from "lucide-react";
import { z } from "zod";

import { type GameLogEntry } from "@/server/games";
import { GameLogDialog } from "@/components/GameLogDialog";
import { PageHeader } from "@/components/page-header";
import { logsQueryOptions } from "@/lib/queries";
import {
  Collapsible,
  CollapsibleContent,
  CollapsibleTrigger,
} from "@/components/ui/collapsible";

const collectionSearchSchema = z.object({
  genre: z.string().optional(),
});

export const Route = createFileRoute("/collection")({
  component: CollectionPage,
  loader: ({ context }) =>
    context.queryClient.ensureQueryData(logsQueryOptions),
  errorComponent: RestrictedAccess,
  validateSearch: (search) => collectionSearchSchema.parse(search),
});

function RestrictedAccess() {
  return (
    <div className="flex flex-col items-center justify-center py-32 text-center border border-border p-12">
      <h2 className="text-4xl font-black uppercase mb-4 text-foreground">
        Restricted Access
      </h2>
      <p className="text-muted-foreground mb-8 max-w-xs mx-auto">
        Authentication is required to view this archive.
      </p>
      <Link
        to="/login"
        className="bg-foreground text-background px-8 py-4 uppercase tracking-widest text-xs font-bold hover:bg-destructive hover:text-destructive-foreground transition-colors"
      >
        Authenticate
      </Link>
    </div>
  );
}

function CollectionPage() {
  const queryClient = useQueryClient();
  const navigate = Route.useNavigate();
  const { genre: selectedGenre } = Route.useSearch();

  const [selectedEntry, setSelectedEntry] = useState<GameLogEntry | null>(null);
  const [isDialogOpen, setIsDialogOpen] = useState(false);
  const [isStatsOpen, setIsStatsOpen] = useState(false);

  const logsQuery = useSuspenseQuery(logsQueryOptions);

  const handleSelectEntry = (entry: GameLogEntry) => {
    setSelectedEntry(entry);
    setIsDialogOpen(true);
  };

  const handleSave = () => {
    queryClient.invalidateQueries({ queryKey: ["gameLogs"] });
  };

  const setSelectedGenre = (genre: string | null) => {
    navigate({
      search: (prev) => ({ ...prev, genre: genre ?? undefined }),
    });
  };

  const logs = logsQuery.data?.logs ?? [];
  const averageScore = logsQuery.data?.averageScore ?? null;
  const genreCounts = logsQuery.data?.genreCounts ?? {};
  const mostPopularGenre = logsQuery.data?.mostPopularGenre ?? null;

  const filteredLogs = selectedGenre
    ? logs.filter((log) => log.genres?.includes(selectedGenre))
    : logs;

  if (logs.length === 0) {
    return (
      <div className="border border-border p-24 text-center">
        <h1 className="text-6xl font-black uppercase mb-4 text-foreground">
          Null Set
        </h1>
        <p className="text-muted-foreground max-w-md mx-auto mb-12">
          The collection is currently empty. Begin data entry to populate the
          archive.
        </p>
        <Link
          to="/"
          className="inline-flex items-center gap-4 bg-foreground text-background px-8 py-4 uppercase tracking-widest text-xs font-bold hover:bg-destructive hover:text-destructive-foreground transition-colors"
        >
          <Plus className="w-4 h-4" />
          Create Entry
        </Link>
      </div>
    );
  }

  return (
    <div>
      <PageHeader title="Collection" subtitle="Archive 01">
        <div className="hidden sm:flex flex-row flex-nowrap items-baseline gap-8 text-right">
          <div className="inline-flex items-baseline gap-2">
            <span className="text-4xl font-bold text-foreground">
              {logs.length.toString().padStart(2, "0")}
            </span>
            <span className="text-xs uppercase tracking-widest text-muted-foreground whitespace-nowrap">
              Total Items
            </span>
          </div>
          {averageScore !== null && (
            <div className="inline-flex items-baseline gap-2">
              <span className="text-4xl font-bold text-foreground">
                {averageScore.toFixed(1)}
              </span>
              <span className="text-xs uppercase tracking-widest text-muted-foreground whitespace-nowrap">
                Avg Score
              </span>
            </div>
          )}
          {mostPopularGenre && (
            <div className="inline-flex items-baseline gap-2">
              <span className="text-4xl font-bold text-foreground truncate max-w-[200px]">
                {mostPopularGenre}
              </span>
              <span className="text-xs uppercase tracking-widest text-muted-foreground whitespace-nowrap">
                Top Genre
              </span>
            </div>
          )}
        </div>
      </PageHeader>

      <Collapsible
        open={isStatsOpen}
        onOpenChange={setIsStatsOpen}
        className="mb-12 border border-border"
      >
        <CollapsibleTrigger className="flex w-full items-center justify-between group p-6">
          <h2 className="text-sm font-bold uppercase tracking-widest text-muted-foreground group-hover:text-foreground transition-colors">
            Genres
          </h2>
          {isStatsOpen ? (
            <ChevronUp className="h-4 w-4 text-muted-foreground" />
          ) : (
            <ChevronDown className="h-4 w-4 text-muted-foreground" />
          )}
        </CollapsibleTrigger>
        <CollapsibleContent className="px-6 pb-6 mt-2">
          {Object.keys(genreCounts).length > 0 ? (
            <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-5 gap-8">
              {Object.entries(genreCounts)
                .sort(([, a], [, b]) => b - a)
                .map(([genre, count]) => (
                  <button
                    key={genre}
                    onClick={() =>
                      setSelectedGenre(selectedGenre === genre ? null : genre)
                    }
                    className={`text-left transition-all group relative ${
                      selectedGenre && selectedGenre !== genre
                        ? "opacity-40"
                        : "opacity-100"
                    }`}
                  >
                    <div
                      className={`text-3xl font-black mb-1 transition-colors ${
                        selectedGenre === genre
                          ? "text-primary"
                          : "text-foreground group-hover:text-primary"
                      }`}
                    >
                      {count.toString().padStart(2, "0")}
                    </div>
                    <div
                      className={`text-xs uppercase tracking-widest transition-colors ${
                        selectedGenre === genre
                          ? "text-primary font-bold"
                          : "text-muted-foreground group-hover:text-primary"
                      }`}
                    >
                      {genre}
                    </div>
                  </button>
                ))}
            </div>
          ) : (
            <p className="text-muted-foreground text-sm">
              No genre data available. Update games to see statistics.
            </p>
          )}
        </CollapsibleContent>
      </Collapsible>

      {selectedGenre && (
        <div className="mb-8 flex items-center gap-2 text-sm">
          <span className="text-muted-foreground">Filtering by:</span>
          <span className="font-bold text-foreground bg-secondary px-2 py-1 rounded">
            {selectedGenre}
          </span>
          <button
            onClick={() => setSelectedGenre(null)}
            className="text-xs uppercase tracking-widest text-muted-foreground hover:text-foreground ml-2"
          >
            Clear Filter
          </button>
        </div>
      )}

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-x-8 gap-y-12">
        {filteredLogs.map((entry) => (
          <div
            key={entry.id}
            className="group flex flex-col cursor-pointer"
            onClick={() => handleSelectEntry(entry)}
          >
            {/* Image */}
            <div className="aspect-[3/4] w-full bg-muted mb-6 relative overflow-hidden">
              {entry.coverUrl ? (
                <img
                  src={entry.coverUrl}
                  alt={entry.name ?? "Game cover"}
                  className="h-full w-full object-cover transition-all duration-500 group-hover:scale-105 group-hover:brightness-110"
                />
              ) : (
                <div className="flex h-full w-full items-center justify-center text-muted-foreground text-xs">
                  N/A
                </div>
              )}

              {/* Rating Overlays */}
              <div className="absolute bottom-0 right-0 flex gap-1.5 p-1.5">
                {entry.metacriticScore && (
                  <div
                    className={`text-white w-12 h-14 flex flex-col items-center justify-center shadow-lg ${
                      entry.metacriticScore >= 75
                        ? "bg-green-600"
                        : entry.metacriticScore >= 50
                          ? "bg-yellow-500"
                          : "bg-red-600"
                    }`}
                    title={`Metascore: ${entry.metacriticScore}`}
                  >
                    <span className="font-bold text-lg leading-none">
                      {entry.metacriticScore}
                    </span>
                    <span className="text-[10px] font-bold uppercase tracking-wide mt-0.5">
                      meta
                    </span>
                  </div>
                )}
                <div
