import { useState, useEffect } from "react";
import { useMutation, useQueryClient } from "@tanstack/react-query";
import { Loader2, X } from "lucide-react";

import {
  saveGameLog,
  type GameSearchResult,
  type GameLogEntry,
} from "@/server/games";
import { Button } from "@/components/ui/button";
import { Dialog, DialogContent } from "@/components/ui/dialog";
import { Label } from "@/components/ui/label";
import { Slider } from "@/components/ui/slider";
import { Textarea } from "@/components/ui/textarea";

type GameLogDialogProps = {
  open: boolean;
  onOpenChange: (open: boolean) => void;
  game: GameSearchResult | GameLogEntry | null;
  onSave?: () => void;
};

export function GameLogDialog({
  open,
  onOpenChange,
  game,
  onSave,
}: GameLogDialogProps) {
  const queryClient = useQueryClient();
  const [rating, setRating] = useState(
    game && "rating" in game ? [game.rating] : [8]
  );
  const [notes, setNotes] = useState(
    game && "notes" in game ? game.notes || "" : ""
  );

  const saveMutation = useMutation({
    mutationFn: async (input: {
      gameId: string;
      name: string;
      coverUrl: string | null;
      summary: string | null;
      releaseYear: number | null;
      rating: number;
      notes: string | null;
      genres: string[] | undefined;
      metacriticScore: number | null | undefined;
    }) => saveGameLog({ data: input }),
    onSuccess: () => {
      queryClient.invalidateQueries({ queryKey: ["gameLogs"] });
    },
  });

  // Reset form when game changes
  useEffect(() => {
    if (game) {
      setRating("rating" in game ? [game.rating] : [8]);
      setNotes("notes" in game ? game.notes || "" : "");
    }
  }, [game]);

  const handleSave = async () => {
    if (!game) return;
    try {
      // GameLogEntry has gameId, GameSearchResult has id
      const gameId =
        "gameId" in game && game.gameId
          ? String(game.gameId)
          : "id" in game
            ? String(game.id)
            : "";
      const gameName = game.name || "";
      const gameCoverUrl = game.coverUrl || null;
      const gameSummary = "summary" in game ? game.summary || null : null;
      const gameReleaseYear = game.releaseYear || null;
      const genres = game.genres || undefined;
      // GameSearchResult has aggregatedRating, GameLogEntry has metacriticScore
      const metacriticScore =
        "metacriticScore" in game
          ? game.metacriticScore
          : "aggregatedRating" in game
            ? game.aggregatedRating
            : null;

      await saveMutation.mutateAsync({
        gameId,
        name: gameName,
        coverUrl: gameCoverUrl,
        summary: gameSummary,
        releaseYear: gameReleaseYear,
        rating: rating[0],
        notes: notes || null,
        genres,
        metacriticScore,
      });
      onSave?.();
      onOpenChange(false);
    } catch (error) {
      console.error("Failed to save log", error);
    }
  };

  if (!game) return null;

  return (
    <Dialog open={open} onOpenChange={onOpenChange}>
      <DialogContent
        className="bg-background border border-border p-0 max-w-3xl rounded-none shadow-none gap-0 outline-none sm:max-w-[800px] w-[95vw] max-h-[85dvh] flex flex-col overflow-hidden z-[100]"
        showCloseButton={false}
      >
        <div className="flex flex-col md:flex-row flex-1 h-full min-h-0">
          {/* Left Column - Image (Hidden on Mobile) */}
          <div className="hidden md:block w-full md:w-2/5 bg-muted border-b md:border-b-0 md:border-r border-border relative overflow-hidden group aspect-[2/3] md:aspect-auto md:h-auto shrink-0">
            {game.coverUrl ? (
              <img
                src={game.coverUrl}
                alt=""
                className="w-full h-full object-cover transition-all duration-700 group-hover:scale-105 group-hover:brightness-110"
              />
            ) : (
              <div className="flex items-center justify-center w-full h-full text-muted-foreground font-mono text-xs">
                NO IMAGE DATA
              </div>
            )}
            <div className="absolute inset-0 bg-black/10 mix-blend-multiply dark:mix-blend-normal pointer-events-none" />

            {/* Title Overlay */}
            <div className="absolute bottom-0 left-0 w-full p-6 bg-gradient-to-t from-black via-black/70 to-transparent pointer-events-none">
              <h2 className="text-2xl md:text-3xl font-bold text-white uppercase leading-none tracking-tight drop-shadow-lg">
                {game.name}
              </h2>
              <p className="text-white/90 font-mono text-xs mt-2 drop-shadow-md">
                {game.releaseYear}
              </p>
            </div>
          </div>

          {/* Right Column - Form */}
          <div className="w-full md:w-3/5 flex flex-col relative h-full min-h-0 bg-background">
            {/* Manual Close Button */}
            <button
              onClick={() => onOpenChange(false)}
              className="absolute top-0 right-0 p-4 hover:bg-muted transition-colors z-20 border-b border-l border-border bg-background"
            >
              <X className="w-4 h-4 text-muted-foreground hover:text-foreground" />
            </button>

            {/* Mobile Header with Small Image */}
            <div className="md:hidden border-b border-border p-4 flex items-center gap-4 bg-background shrink-0 pr-16">
              <div className="w-12 h-16 bg-muted shrink-0">
                {game.coverUrl ? (
                  <img
                    src={game.coverUrl}
                    alt=""
                    className="w-full h-full object-cover"
                  />
                ) : (
                  <div className="flex items-center justify-center w-full h-full text-muted-foreground text-[10px] font-mono">
                    N/A
                  </div>
                )}
              </div>
              <div className="flex-1 min-w-0">
                <h2 className="text-lg font-bold uppercase leading-tight tracking-tight truncate text-foreground">
                  {game.name}
                </h2>
                <p className="font-mono text-xs text-muted-foreground mt-1">
                  {game.releaseYear || "----"}
                </p>
              </div>
            </div>

            <div className="p-4 md:p-8 flex-1 flex flex-col justify-center space-y-8 md:space-y-12 overflow-y-auto pt-16 md:pt-20">
              {/* Rating Section */}
              <div className="space-y-6">
                <div className="flex justify-between items-baseline border-b border-border pb-2">
                  <Label className="uppercase text-[10px] font-bold tracking-widest text-muted-foreground">
                    Rating Assessment
                  </Label>
                  <span className="text-4xl md:text-5xl font-medium tracking-tighter text-foreground">
                    {rating[0]}
                  </span>
                </div>

                <div className="px-2">
                  <Slider
                    value={rating}
                    onValueChange={setRating}
                    min={0}
                    max={10}
                    step={1}
                    className="cursor-pointer py-4"
                  />
                  <div className="flex justify-between mt-2 font-mono text-[10px] text-muted-foreground uppercase">
                    <span>00</span>
                    <span>05</span>
                    <span>10</span>
                  </div>
                </div>
              </div>

              {/* Analysis Section */}
              <div className="space-y-4">
                <Label className="uppercase text-[10px] font-bold tracking-widest text-muted-foreground">
                  Analysis Log
                </Label>
                <Textarea
                  value={notes}
                  onChange={(e) => setNotes(e.target.value)}
                  placeholder="Enter observations..."
                  className="border border-border rounded-none p-4 resize-none focus:border-foreground focus:ring-0 text-sm leading-relaxed min-h-[120px] bg-transparent shadow-none placeholder:text-muted-foreground font-mono text-foreground"
                />
              </div>
            </div>

            <Button
              onClick={handleSave}
              disabled={saveMutation.isPending}
              className="w-full bg-foreground hover:bg-destructive text-background rounded-none h-16 text-xs uppercase tracking-[0.2em] font-bold transition-colors flex items-center justify-center gap-4 shrink-0"
            >
              {saveMutation.isPending ? (
                <Loader2 className="animate-spin w-4 h-4" />
              ) : (
                "Confirm Entry"
              )}
            </Button>
          </div>
        </div>
      </DialogContent>
    </Dialog>
  );
}

