        // Wait for dialog to close
        await page.waitForSelector('[role="dialog"]', { state: 'hidden', timeout: 10000 });
        console.log(`  âœ… Added: ${gameName}`);

        await page.waitForTimeout(1000);
      } catch (err) {
        console.log(`  âš ï¸ Could not add ${gameName}: ${err.message}`);
