const { chromium } = require('playwright');

// Parameterized URL
const TARGET_URL = 'http://localhost:3000';

// Generate unique credentials
const timestamp = Date.now();
const TEST_EMAIL = `test_${timestamp}@gametracker.local`;
const TEST_PASSWORD = `SecureP@ss${timestamp}!Gm`;

// List of games to search and add (popular games that should be in IGDB)
const GAMES_TO_ADD = [
  'Zelda Breath of the Wild',
  'Red Dead Redemption 2',
  'God of War',
  'Elden Ring',
  'Witcher 3'
];

(async () => {
  console.log('=== Game Tracker Automation Test ===');
  console.log(`Target URL: ${TARGET_URL}`);
  console.log(`Test Email: ${TEST_EMAIL}`);
  console.log(`Test Password: ${TEST_PASSWORD}`);
  console.log('');

  const browser = await chromium.launch({
    headless: false,
    slowMo: 100
  });
  const context = await browser.newContext({
    viewport: { width: 1280, height: 900 }
  });
  const page = await context.newPage();

  try {
    // ========== STEP 1: Create Account ==========
    console.log('STEP 1: Creating new account...');
    await page.goto(`${TARGET_URL}/login`);
    await page.waitForLoadState('networkidle');

    // Click on Register tab
    await page.click('button:has-text("Register")');
    await page.waitForTimeout(500);

    // Fill in registration form
    await page.fill('input[type="email"]', TEST_EMAIL);
    await page.fill('input[type="password"]', TEST_PASSWORD);

    // Click submit button (Create Account)
    await page.click('button[type="submit"]');

    // Wait for either: LOGOUT link (auto-login) OR "Account created" message
    // Use Promise.race to detect whichever comes first
    console.log('  Waiting for registration result...');

    const result = await Promise.race([
      page.waitForSelector('a:has-text("LOGOUT")', { timeout: 15000 }).then(() => 'auto-login'),
      page.waitForSelector('text=Account created', { timeout: 15000 }).then(() => 'success-message'),
    ]).catch(() => 'timeout');

    if (result === 'auto-login') {
      console.log('âœ… Account created and automatically logged in!');
    } else if (result === 'success-message') {
      console.log('âœ… Account created! Now logging in...');

      // Click on Login tab to switch to login mode
      await page.click('button:has-text("Login")');
      await page.waitForTimeout(500);

      // Clear and fill login form
      const emailInput = page.locator('input[type="email"]');
      const passwordInput = page.locator('input[type="password"]');

      await emailInput.clear();
      await emailInput.fill(TEST_EMAIL);
      await passwordInput.clear();
      await passwordInput.fill(TEST_PASSWORD);

      // Click submit button (Enter System)
      await page.click('button[type="submit"]');

      // Wait for redirect to home page
      await page.waitForSelector('a:has-text("LOGOUT")', { timeout: 15000 });
      console.log('âœ… Login successful!');
    } else {
      throw new Error('Registration did not complete in time');
    }

    await page.screenshot({ path: '/tmp/screenshot-1-logged-in.png', fullPage: true });

    // ========== STEP 2: Add 5 Games ==========
    console.log('STEP 2: Adding 5 games with rating 9...');

    for (let i = 0; i < GAMES_TO_ADD.length; i++) {
      const gameName = GAMES_TO_ADD[i];
      console.log(`  Adding game ${i + 1}/5: ${gameName}`);

      // Navigate to home page if not there
      await page.goto(`${TARGET_URL}/`);
      await page.waitForLoadState('networkidle');
      await page.waitForTimeout(500);

      // Search for the game - use the cmdk input
      const searchInput = page.locator('input[placeholder*="SEARCH"]');
      await searchInput.waitFor({ state: 'visible', timeout: 5000 });
      await searchInput.click();
      await searchInput.fill(gameName);

      // Wait for search results to load
      await page.waitForTimeout(2500);

      // Click on the first result
      try {
        // Wait for command items to appear
        const firstResult = page.locator('[cmdk-item]').first();
        await firstResult.waitFor({ state: 'visible', timeout: 15000 });
        await firstResult.click();

        // Wait for dialog to open
        await page.waitForSelector('[role="dialog"]', { timeout: 5000 });
        await page.waitForTimeout(500);

        // Set rating to 9 using the slider
        const sliderTrack = page.locator('[role="slider"]').first();
        await sliderTrack.waitFor({ state: 'visible', timeout: 5000 });

        // Get the slider container bounding box
        const sliderContainer = page.locator('span[data-orientation="horizontal"]').first();
        const boundingBox = await sliderContainer.boundingBox();

        if (boundingBox) {
          // Rating 9 out of 10 = 90% of the slider width
          const targetX = boundingBox.x + (boundingBox.width * 0.9);
          const targetY = boundingBox.y + (boundingBox.height / 2);
          await page.mouse.click(targetX, targetY);
          await page.waitForTimeout(500);
        }

        // Verify rating shows 9
        const ratingText = await page.locator('[role="dialog"] span.text-4xl, [role="dialog"] span.text-5xl').first().textContent();
        console.log(`    Rating set to: ${ratingText}`);

        // Click Confirm Entry button
        const confirmButton = page.locator('button:has-text("Confirm Entry")');
        await confirmButton.waitFor({ state: 'visible', timeout: 5000 });
        await confirmButton.click();

        // Wait for dialog to close
        await page.waitForSelector('[role="dialog"]', { state: 'hidden', timeout: 10000 });
        console.log(`  âœ… Added: ${gameName}`);

        await page.waitForTimeout(1000);
      } catch (err) {
        console.log(`  âš ï¸ Could not add ${gameName}: ${err.message}`);
        // Take screenshot on error
        await page.screenshot({ path: `/tmp/screenshot-error-game-${i}.png`, fullPage: true });
        // Try to close any open dialog by pressing Escape
        await page.keyboard.press('Escape').catch(() => {});
        await page.waitForTimeout(500);
      }
    }

    await page.screenshot({ path: '/tmp/screenshot-2-games-added.png', fullPage: true });

    // ========== STEP 3: View Collection ==========
    console.log('STEP 3: Viewing collection...');

    // Navigate to collection page
    await page.click('a:has-text("COLLECTION")');
    await page.waitForLoadState('networkidle');
    await page.waitForTimeout(2000);

    // Take screenshot of collection
    await page.screenshot({ path: '/tmp/screenshot-3-collection.png', fullPage: true });

    // Count items in collection
    const gameCards = await page.locator('.grid > div.group.cursor-pointer').count();
    console.log(`âœ… Collection page loaded with ${gameCards} game(s)`);

    // Check for stats
    const totalItems = await page.locator('text=Total Items').isVisible().catch(() => false);
    if (totalItems) {
      console.log('âœ… Total Items stat is displayed');
    }

    const avgScore = await page.locator('text=Avg Score').isVisible().catch(() => false);
    if (avgScore) {
      console.log('âœ… Average score is displayed');
    }

    console.log('');
    console.log('=== Test Complete ===');
    console.log('Screenshots saved to /tmp/screenshot-*.png');
    console.log(`Created account: ${TEST_EMAIL}`);
    console.log(`Password: ${TEST_PASSWORD}`);

  } catch (error) {
    console.error('âŒ Test failed:', error.message);
    await page.screenshot({ path: '/tmp/screenshot-error.png', fullPage: true });
    console.log('Error screenshot saved to /tmp/screenshot-error.png');
  } finally {
    await page.waitForTimeout(3000); // Keep browser open for a moment to see final state
    await browser.close();
  }
})();

