const TEST_PASSWORD = `SecureP@ss${timestamp}!Gm`;

// List of games to search and add (popular games that should be in IGDB)
const GAMES_TO_ADD = [
  'Zelda Breath of the Wild',
  'Red Dead Redemption 2',
  'God of War',
  'Elden Ring',
  'Witcher 3'
];

(async () => {
  console.log('=== Game Tracker Automation Test ===');
  console.log(`Target URL: ${TARGET_URL}`);
  console.log(`Test Email: ${TEST_EMAIL}`);
  console.log(`Test Password: ${TEST_PASSWORD}`);
  console.log('');

  const browser = await chromium.launch({
    headless: false,
    slowMo: 100
  });
  const context = await browser.newContext({
    viewport: { width: 1280, height: 900 }
  });
  const page = await context.newPage();

  try {
    // ========== STEP 1: Create Account ==========
    console.log('STEP 1: Creating new account...');
    await page.goto(`${TARGET_URL}/login`);
    await page.waitForLoadState('networkidle');

    // Click on Register tab
    await page.click('button:has-text("Register")');
    await page.waitForTimeout(500);

    // Fill in registration form
    await page.fill('input[type="email"]', TEST_EMAIL);
    await page.fill('input[type="password"]', TEST_PASSWORD);

    // Click submit button (Create Account)
    await page.click('button[type="submit"]');

    // Wait for either: LOGOUT link (auto-login) OR "Account created" message
    // Use Promise.race to detect whichever comes first
    console.log('  Waiting for registration result...');

    const result = await Promise.race([
      page.waitForSelector('a:has-text("LOGOUT")', { timeout: 15000 }).then(() => 'auto-login'),
      page.waitForSelector('text=Account created', { timeout: 15000 }).then(() => 'success-message'),
    ]).catch(() => 'timeout');

    if (result === 'auto-login') {
      console.log('âœ… Account created and automatically logged in!');
    } else if (result === 'success-message') {
      console.log('âœ… Account created! Now logging in...');

      // Click on Login tab to switch to login mode
      await page.click('button:has-text("Login")');
      await page.waitForTimeout(500);

      // Clear and fill login form
      const emailInput = page.locator('input[type="email"]');
      const passwordInput = page.locator('input[type="password"]');

      await emailInput.clear();
      await emailInput.fill(TEST_EMAIL);
      await passwordInput.clear();
      await passwordInput.fill(TEST_PASSWORD);

      // Click submit button (Enter System)
      await page.click('button[type="submit"]');

      // Wait for redirect to home page
      await page.waitForSelector('a:has-text("LOGOUT")', { timeout: 15000 });
      console.log('âœ… Login successful!');
    } else {
      throw new Error('Registration did not complete in time');
    }

    await page.screenshot({ path: '/tmp/screenshot-1-logged-in.png', fullPage: true });

