    console.log('STEP 2: Adding 5 games with rating 9...');

    for (let i = 0; i < GAMES_TO_ADD.length; i++) {
      const gameName = GAMES_TO_ADD[i];
      console.log(`  Adding game ${i + 1}/5: ${gameName}`);

      // Navigate to home page if not there
      await page.goto(`${TARGET_URL}/`);
      await page.waitForLoadState('networkidle');
      await page.waitForTimeout(500);

      // Search for the game - use the cmdk input
      const searchInput = page.locator('input[placeholder*="SEARCH"]');
      await searchInput.waitFor({ state: 'visible', timeout: 5000 });
      await searchInput.click();
      await searchInput.fill(gameName);

      // Wait for search results to load
      await page.waitForTimeout(2500);

      // Click on the first result
      try {
        // Wait for command items to appear
        const firstResult = page.locator('[cmdk-item]').first();
        await firstResult.waitFor({ state: 'visible', timeout: 15000 });
        await firstResult.click();

        // Wait for dialog to open
        await page.waitForSelector('[role="dialog"]', { timeout: 5000 });
        await page.waitForTimeout(500);

        // Set rating to 9 using the slider
        const sliderTrack = page.locator('[role="slider"]').first();
        await sliderTrack.waitFor({ state: 'visible', timeout: 5000 });

        // Get the slider container bounding box
        const sliderContainer = page.locator('span[data-orientation="horizontal"]').first();
        const boundingBox = await sliderContainer.boundingBox();

        if (boundingBox) {
          // Rating 9 out of 10 = 90% of the slider width
          const targetX = boundingBox.x + (boundingBox.width * 0.9);
          const targetY = boundingBox.y + (boundingBox.height / 2);
          await page.mouse.click(targetX, targetY);
          await page.waitForTimeout(500);
        }

        // Verify rating shows 9
        const ratingText = await page.locator('[role="dialog"] span.text-4xl, [role="dialog"] span.text-5xl').first().textContent();
        console.log(`    Rating set to: ${ratingText}`);

        // Click Confirm Entry button
        const confirmButton = page.locator('button:has-text("Confirm Entry")');
