import {
  HeadContent,
  Scripts,
  createRootRouteWithContext,
  Link,
  useNavigate,
} from "@tanstack/react-router";
import { CircleDot, Menu } from "lucide-react";

import { authClient } from "@/lib/auth-client";
import { ThemeProvider } from "@/components/theme-provider";
import { DitheringBackground } from "@/components/dithering-background";
import { Button } from "@/components/ui/button";
import {
  DropdownMenu,
  DropdownMenuContent,
  DropdownMenuItem,
  DropdownMenuTrigger,
} from "@/components/ui/dropdown-menu";
import appCss from "../styles.css?url";
import { RouterContext } from "@/router";

export const Route = createRootRouteWithContext<RouterContext>()({
  head: () => ({
    meta: [
      { charSet: "utf-8" },
      { name: "viewport", content: "width=device-width, initial-scale=1" },
      { title: "Game.DB" },
    ],
    links: [
      { rel: "stylesheet", href: appCss },
      { rel: "icon", href: "/favicon.svg", type: "image/svg+xml" },
    ],
    scripts: [
      {
        children: `(function() {
  try {
    var isDark = window.matchMedia('(prefers-color-scheme: dark)').matches;
    document.documentElement.classList.toggle('dark', isDark);
    document.documentElement.classList.toggle('light', !isDark);
  } catch (e) {}
})()`,
      },
    ],
  }),
  shellComponent: RootDocument,
});

function RootDocument({ children }: { children: React.ReactNode }) {
  const session = authClient.useSession();
  const navigate = useNavigate();
  const isAuthenticated = !!session.data?.user;

  const handleLogout = async () => {
    await authClient.signOut();
    navigate({ to: "/login" });
  };

  return (
    <html lang="en">
      <head>
        <HeadContent />
      </head>
      <body className="antialiased font-inter bg-background text-foreground selection:bg-primary selection:text-primary-foreground relative">
        <ThemeProvider defaultTheme="system" storageKey="vite-ui-theme">
          <DitheringBackground />
          <div className="min-h-screen flex flex-col relative">
            {/* Minimalist Header - Fixed Grid */}
            <header className="bg-background border-b border-border sticky top-0 z-50 transition-colors">
              <div className="max-w-[1400px] mx-auto px-6 h-16 flex items-center justify-between gap-4">
                <div className="flex items-center gap-2">
                  <Link to="/" className="flex items-center gap-2 group">
                    <CircleDot className="w-5 h-5 text-primary group-hover:text-foreground transition-colors" />
                    <span className="font-bold text-sm tracking-tight uppercase">
                      Game.DB
                    </span>
                  </Link>
                </div>

                <nav className="hidden md:flex justify-end gap-8 items-center">
                  <Link
                    to="/"
                    className="text-xs font-bold uppercase tracking-widest text-muted-foreground hover:text-foreground transition-colors [&.active]:text-foreground"
                  >
                    Index
                  </Link>

                  <Link
                    to="/collection"
                    className="text-xs font-bold uppercase tracking-widest text-muted-foreground hover:text-foreground transition-colors [&.active]:text-foreground"
                  >
                    Collection
                  </Link>

                  {isAuthenticated && (
                    <button
                      onClick={handleLogout}
                      className="text-xs font-bold uppercase tracking-widest text-muted-foreground hover:text-foreground transition-colors"
                    >
                      Logout
                    </button>
                  )}
                </nav>

                <div className="md:hidden">
                  <DropdownMenu>
                    <DropdownMenuTrigger asChild>
                      <Button variant="ghost" size="icon" className="-mr-2">
                        <Menu className="w-5 h-5" />
                        <span className="sr-only">Open menu</span>
                      </Button>
                    </DropdownMenuTrigger>
                    <DropdownMenuContent align="end">
                      <DropdownMenuItem asChild>
                        <Link to="/" className="w-full cursor-pointer">
                          Index
                        </Link>
                      </DropdownMenuItem>
                      <DropdownMenuItem asChild>
                        <Link
                          to="/collection"
                          className="w-full cursor-pointer"
                        >
                          Collection
                        </Link>
                      </DropdownMenuItem>
                      {isAuthenticated && (
                        <DropdownMenuItem
                          onClick={handleLogout}
                          className="cursor-pointer"
                        >
                          Logout
                        </DropdownMenuItem>
                      )}
                    </DropdownMenuContent>
                  </DropdownMenu>
                </div>
              </div>
            </header>

            <main className="flex-1 w-full max-w-[1400px] mx-auto px-6 py-8">
              {children}
            </main>
          </div>
          <Scripts />
        </ThemeProvider>
      </body>
    </html>
  );
}

